import TableCard from "src/views/table/TableCard";

const PendingPayments= ()=>{

  const Button=id=>{
    return <button style={{width:"100%",

              color:"#000"
  }}  className="btn btn-success fa fa-history"></button>
  }
    const columns = [
      {
        dataField: "check",
        text: <span className="fa fa-check badge badge-success"></span>,

      },
        {
          dataField: "#taskId",
          text: "#taskId",

        },

        {
          dataField: "invoiceId",
          text: "#Invoice Id",

        },
        {
          dataField: "email",
          text: "Writer email",

        },
        {

            dataField: "status",
            text: "status",


        },

        {

          dataField: "pdate",
          text: "Expected-Day-Pay",


      },
        {
            dataField: "Action",
            text: "Action",

          }
      ];
      const products=[
          {
            check:<input type="checkbox"/>
          }

      ]
    return <>
             <div className="container card">
             <TableCard 
             products={products}
             columns={columns}
              title={"PENDING PAYMENTS"}
             />
             </div>
          </>

}
export default PendingPayments;
